// Level1.js

import React from 'react';
import { View, Text, Button } from 'react-native';
import { useNavigation } from '@react-navigation/native';

function Level1() {
  const navigation = useNavigation();

  const goToLevel1Screen = () => {
    navigation.navigate('Level1'); // Navigate to the same screen (Level 1 in this case)
  };

  return (
    <View>
      <Text>This is Level 1 lool</Text>
      <Button title="Go to Level 1" onPress={goToLevel1Screen} />
    </View>
  );
}

export default Level1;
